Here's the main code of the project, which you should put in the azle_hello_world/src/index.ts file of your canister: import { $query, $update } from 'azle'; // This is a global variable that is stored on the heap
let message: string = ''; // Query calls complete quickly because they do not go through consensus
$query;
export function get_message(): string { return message;
} // Update calls take a few seconds to complete
// This is because they persist state changes and go through consensus
$update;
export function set_message(new_message: string) { message = new_message; // This change will be persisted
} Let's discuss each section of the code. import { $query, $update } from 'azle'; The code starts off by importing the $query and $update annotations from azle. The azle module provides most of the Internet Computer (IC) APIs for your canister. // This is a global variable that is stored on the heap
let message: string = ''; We have created a global variable to store the state of our application. This variable is in scope to all of the functions defined in this module. We have annotated it with a type and set it equal to an empty string. // Query calls complete quickly because they do not go through consensus
$query;
export function get_message(): string { return message;
} We are exposing a canister query method here. When query methods are called they execute quickly because they do not have to go through consensus. This method simply returns our global message variable. // Update calls take a few seconds to complete
// This is because they persist state changes and go through consensus
$update;
export function set_message(new_message: string) { message = new_message; // This change will be persisted
} We are exposing an update method here. When update methods are called they take a few seconds to complete. This is because they persist changes and go through consensus. A majority of nodes in a subnet must agree on all state changes introduced in calls to update methods. This method accepts a string from the caller and will store it in our global message variable. That's it! We've created a very simple getter/setter Hello World application. But no Hello World project is complete without actually yelling Hello world! To do that, we'll need to setup the rest of our project.

