Annotate functions with $query Read-only Executed on a single node No consensus Latency on the order of ~100 milliseconds 5 billion Wasm instruction limit ~32k queries per second per canister TODO double-check this The most basic way to expose your canister's functionality publicly is through a query method. Here's an example of a simple query method: import { $query } from 'azle'; $query;
export function get_string(): string { return 'This is a query method!';
} get_string can be called from the outside world through the IC's HTTP API. You'll usually invoke this API from the dfx command line, dfx web UI, or an agent . From the dfx command line you can call it like this: dfx canister call my_canister get_string Query methods are read-only. They do not persist any state changes. Take a look at the following example: import { $query } from 'azle'; let db = {}; $query;
export function set(key: string, value: string): void { db[key] = value;
} Calling set will perform the operation of setting the key property on the db object to value, but after the call finishes that change will be discarded. This is because query methods are executed on a single node machine and do not go through consensus. This results in lower latencies, perhaps on the order of 100 milliseconds. There is a limit to how much computation can be done in a single call to a query method. The current query call limit is 5 billion Wasm instructions . Here's an example of a query method that runs the risk of reaching the limit: import { nat32, $query } from 'azle'; $query;
export function pyramid(levels: nat32): string { return new Array(levels).fill(0).reduce((acc, _, index) => { const asterisks = new Array(index + 1).fill('*').join(''); return `${acc}${asterisks}\n`; }, '');
} From the dfx command line you can call pyramid like this: dfx canister call pyramid '(600)' With an argument of 600, pyramid will fail with an error ...exceeded the instruction limit for single message execution. In terms of query performance, an individual canister probably has an upper bound of ~36k queries per second .

